import React from "react";
import {Typography} from "@material-ui/core";
import {graphql} from "@apollo/client";
import {text} from './queries'

export const Home = () => {
    const helloTxt = graphql(text)
    return (
        <div>
            <Typography>{helloTxt}</Typography>
        </div>
    )
}
